
      <!DOCTYPE html>
      <html>
      <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
        <title>New Year - Paul</title>
        <link href="https://fonts.googleapis.com/css2?family=Dancing+Script:wght@700&family=Playfair+Display:wght@700&family=Lobster&family=Courier+Prime&family=Inter:wght@400;700&family=Orbitron:wght@500;900&family=Cinzel:wght@500&family=Press+Start+2P&display=swap" rel="stylesheet">
        <style>
      @keyframes fall { 0% { transform: translateY(-10vh) rotate(0deg); opacity: 1; } 100% { transform: translateY(110vh) rotate(360deg); opacity: 0; } }
      @keyframes floatUp { 0% { transform: translateY(110vh) scale(0.5); opacity: 0; } 50% { opacity: 1; } 100% { transform: translateY(-10vh) scale(1.5); opacity: 0; } }
      @keyframes pop { 0% { transform: scale(0); opacity: 0; } 50% { transform: scale(1.5); opacity: 1; } 100% { transform: scale(1); opacity: 0; } }
      @keyframes pulse-bubble { 0% { box-shadow: 0 0 0 0 rgba(255, 255, 255, 0.4); } 70% { box-shadow: 0 0 0 20px rgba(255, 255, 255, 0); } 100% { box-shadow: 0 0 0 0 rgba(255, 255, 255, 0); } }
      @keyframes fadeInScale { from { transform: translate(-50%, -50%) scale(0.8); opacity: 0; } to { transform: translate(-50%, -50%) scale(1); opacity: 1; } }

      .effect-container { position: absolute; inset: 0; pointer-events: none; overflow: hidden; z-index: 50; }
      .particle { position: absolute; will-change: transform; }
      
      body { margin: 0; padding: 0; display: flex; justify-content: center; align-items: center; min-height: 100vh; background-color: #000; font-family: Orbitron, sans-serif; overflow: hidden; }
      
      .card-wrapper { 
        position: relative; 
        width: 100%; 
        max-width: 500px; 
        height: 100vh;
        /* Background acts as the base frame */
        background: linear-gradient(135deg, #3b82f6 0%, #2dd4bf 100%);
        overflow: hidden; 
        box-shadow: 0 0 50px rgba(0,0,0,0.5);
      }

      @media (min-width: 520px) {
        .card-wrapper {
            height: 90vh;
            border-radius: 20px;
        }
      }
      
      .media-container { 
          position: absolute; inset: 0; z-index: 10;
          display: flex; align-items: center; justify-content: center;
      }
      
      .card-image { width: 100%; height: 100%; object-fit: contain; } 
      .card-video { width: 100%; height: 100%; object-fit: contain; }
      
      /* Bubble Trigger */
      .bubble-trigger {
          position: absolute;
          bottom: 40px;
          left: 50%;
          transform: translateX(-50%);
          z-index: 80;
          background: rgba(255, 255, 255, 0.2);
          backdrop-filter: blur(10px);
          -webkit-backdrop-filter: blur(10px);
          border: 1px solid rgba(255, 255, 255, 0.4);
          padding: 12px 24px;
          border-radius: 50px;
          color: white;
          font-weight: bold;
          cursor: pointer;
          display: flex;
          align-items: center;
          gap: 10px;
          animation: pulse-bubble 2s infinite;
          transition: all 0.3s ease;
          box-shadow: 0 4px 15px rgba(0,0,0,0.3);
      }
      .bubble-trigger:hover {
          background: rgba(255, 255, 255, 0.3);
          transform: translateX(-50%) scale(1.05);
      }
      .bubble-trigger.hidden {
          opacity: 0;
          pointer-events: none;
          transform: translateX(-50%) translateY(20px);
      }

      /* Modal Content */
      .content { 
          position: absolute;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%) scale(0.9);
          width: 85%;
          max-height: 80vh;
          overflow-y: auto;
          z-index: 100;
          
          background: rgba(20, 20, 20, 0.85); 
          backdrop-filter: blur(20px); 
          -webkit-backdrop-filter: blur(20px);
          border: 1px solid rgba(255, 255, 255, 0.2);
          box-shadow: 0 20px 50px rgba(0, 0, 0, 0.5);
          
          border-radius: 24px;
          padding: 30px; 
          text-align: center; 
          
          opacity: 0;
          pointer-events: none;
          transition: all 0.4s cubic-bezier(0.16, 1, 0.3, 1);
      }
      
      .content.open {
          opacity: 1;
          pointer-events: auto;
          transform: translate(-50%, -50%) scale(1);
      }

      .close-btn {
          position: absolute;
          top: 15px;
          right: 15px;
          background: rgba(255,255,255,0.1);
          border: none;
          color: white;
          width: 30px;
          height: 30px;
          border-radius: 50%;
          cursor: pointer;
          font-size: 16px;
          line-height: 30px;
          transition: background 0.2s;
      }
      .close-btn:hover { background: rgba(255,255,255,0.3); }
      
      h1 { margin: 0 0 15px; color: #ffffff; font-size: 26px; text-transform: uppercase; letter-spacing: 2px; }
      p { color: #ffffff; line-height: 1.6; font-size: 18px; white-space: pre-wrap; margin-bottom: 20px; }
      small { color: #ffffff; opacity: 0.7; font-size: 0.9em; display: block; margin-bottom: 15px; }
      
      .audio-controls { width: 100%; display: flex; justify-content: center; margin-top: 10px; }
      audio { width: 100%; height: 40px; opacity: 0.9; border-radius: 20px; }
    </style>

        <script>
      // Interaction Logic
      const bubble = document.getElementById('bubble');
      const content = document.getElementById('content');
      const closeBtn = document.getElementById('closeBtn');

      bubble.addEventListener('click', () => {
          content.classList.add('open');
          bubble.classList.add('hidden');
      });

      closeBtn.addEventListener('click', () => {
          content.classList.remove('open');
          bubble.classList.remove('hidden');
      });

      // Effects Logic
      const container = document.createElement('div');
      container.className = 'effect-container';
      const effect = "None";
      
      const config = {
           'Confetti': { char: '', anim: 'fall', count: 60, speed: 3 },
           'Hearts': { char: '', anim: 'floatUp', count: 40, speed: 5 },
           'Snow': { char: '', anim: 'fall', count: 80, speed: 6 },
           'Sparkles': { char: '', anim: 'pop', count: 50, speed: 2 },
           'Fireworks': { char: '*', anim: 'pop', count: 40, speed: 1.5 },
           'Balloons': { char: '', anim: 'floatUp', count: 30, speed: 8 },
           'Lasers': { char: '|', anim: 'laser', count: 20, speed: 2 },
           'Matrix Rain': { char: '01', anim: 'matrix', count: 100, speed: 2 },
           'Cosmic Stars': { char: '', anim: 'starFloat', count: 70, speed: 4 },
           'Digital Glitch': { char: '', anim: 'glitch', count: 10, speed: 0.2 }
      }[effect] || { char: '', anim: '', count: 0, speed: 0 };

      if(effect !== 'None') {
        for(let i=0; i < config.count; i++) {
          const el = document.createElement('div');
          el.className = 'particle';
          // ... (simplified logic for particles same as before)
           if(effect === 'Matrix Rain') {
             el.textContent = Math.random() > 0.5 ? '1' : '0';
             el.style.color = '#0f0';
             el.style.fontSize = '14px';
             el.style.left = Math.floor(Math.random() * 100) + '%';
             el.style.opacity = Math.random();
          } else {
             el.textContent = config.char;
             el.style.left = Math.random() * 100 + '%';
             el.style.top = Math.random() * 100 + '%';
             el.style.color = 'hsl(' + (Math.random() * 360) + ', 80%, 60%)';
             el.style.fontSize = (Math.random() * 20 + 10) + 'px';
          }
          el.style.animation = config.anim + ' ' + (Math.random() * config.speed + 2) + 's linear infinite';
          container.appendChild(el);
        }
        document.body.appendChild(container);
      }
    </script>
